script: |
  super -f text -I q8516.spq | sort > q8516.out

inputs:
  - name: q8516.spq
    data: |
      SELECT DISTINCT 6 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col2 + 60 + + - ( + col0 ) / + col2 NOT IN ( - + col2 + - + col0, + 67 * + 1, - 97, + + col2, CAST ( - + col0 AS INTEGER ) * - 18 );
  - name: tab1

outputs:
  - name: q8516.out
    data: |
      6
